The track was released as the first single from Cyrus' new album of the same name &quot;Can't Be Tamed&quot;, released on June 21st 2010. 
 The song received airplay on radio internationally on May 3rd and was made available as a digital download on May 18th. 
 The song received a positive reception from fans, who liked the new style shown by Cyrus in this song. Rob Sheffield of Rolling Stone rated the song three out of five stars and compared it to the musical styles of Rihanna. He added, &quot;It's no 'Party in the U.S.A.' or 'See You Again,' but the chorus packs plenty of electro-fizz pizzazz.&quot; Jarett Wieselman of The New York Post said he liked the song and that though he did not buy Cyrus' &quot;Party in the U.S.A.&quot; (2009), he feared he would not &quot;be able to resist&quot; buying &quot;Can't Be Tamed&quot;. He said the song had a &quot;naughty old school Britney Spears&quot; vibe, called it &quot;totally catchy&quot; and predicted it would be a summer hit. Ailbhe Malone of The Irish Times wrote, &quot;Miley’s taken a sexy electro-edge. Less &quot;Party in the U.S.A.&quot;, more Party With My Parents Away, we like this. A LOT.&quot;

 According to <a href="http://www.songfacts.com" rel="nofollow">Songfacts</a>, Miley's label, Hollywood Records, said  <a href="http://www.songfacts.com/detail.php?id=19440" rel="nofollow">Can't Be Tamed</a> is &quot;a self-empowering song in which Miley asserts that she has to stay true to herself in relationships, and it is sure to become an anthem among her legions of fans around the world.&quot;

 The music video for the track premiered on May 4th on the television network &quot;E!&quot;. It features Cyrus on display in a birdcage, with dancers behind her.

